(55, 0, 'asdas', 'global $db;\r\n$sql="SELECT * from page order by creation_date desc LIMIT 0, 20";\r\n$result = $db->find_by_sql($sql);\r\n\r\necho ''<ul class="page_list">'';\r\nforeach($result as $records){\r\n$data = ''<li>'';\r\n$data .= ''<a href="'';\r\n$data .= HOME_URL;\r\n$data .= ''extensions/page/pages.php?page_id='';\r\n$data .= $records->page_id;\r\n$data .= ''">'';\r\n$data .= $records->subject.''-''.$records->last_update_date;\r\n$data .= ''</a></li>'';\r\necho $data ;\r\n}\r\necho ''</ul>'';', 1, NULL, '', NULL, 0, 0, '', 0, '2013-08-23 15:48:28', 0, '2013-08-23 15:48:28'),
(64, NULL, 'The CSS Details', 'The .css() method is a convenient way to get a style property from the first matched element, especially in light of the different ways browsers access most of those properties (the getComputedStyle() method in standards-based browsers versus the currentStyle and runtimeStyle properties in Internet Explorer) and the different terms browsers use for certain properties. For example, Internet Explorer''s DOM implementation refers to the float property as styleFloat, while W3C standards-compliant browsers refer to it as cssFloat. For consistency, you can simply use "float", and jQuery will translate it to the correct value for each browser.\r\n\r\nAlso, jQuery can equally interpret the CSS and DOM formatting of multiple-word properties. For example, jQuery understands and returns the correct value for both .css( "background-color" ) and .css( "backgroundColor" ). Different browsers may return CSS color values that are logically but not textually equal, e.g., #FFF, #ffffff, and rgb(255,255,255).\r\n\r\nShorthand CSS properties (e.g. margin, background, border) are not supported. For example, if you want to retrieve the rendered margin, use: $( elem ).css( "marginTop" ) and $( elem ).css( "marginRight" ), and so on.\r\n\r\nAs of jQuery 1.9, passing an array of style properties to .css() will resu', NULL, 1, NULL, 1, NULL, NULL, NULL, 0, '2013-08-23 19:58:41', 0, '2013-08-23 19:58:41'),
(65, 0, '', '<?php \r\nglobal $db;\r\n$sql="SELECT content.content_id as content_id, content.subject as subject from content, c_forum  where c_forum.content_id=content.content_id order by content.creation_date desc LIMIT 0, 20";\r\n$result = $db->result_array($sql);\r\n\r\necho ''<ul class="forum_list">'';\r\nforeach($result as $records){\r\n$data = ''<li>'';\r\n$data .= ''<a href="'';\r\n$data .= HOME_URL;\r\n$data .= ''extensions/content/contents.php?content_id='';\r\n$data .= $records[''content_id''];\r\n$data .= ''&content_type=c_forum'';\r\n$data .= ''">'';\r\n$data .= $records[''subject''];\r\n$data .= ''</a></li>'';\r\necho $data ;\r\n}\r\necho ''</ul>'';', NULL, NULL, '', 0, 0, 0, '', 0, '2013-08-29 15:37:25', 0, '2013-08-29 15:37:25'),
